    this.b_prime_ref_j.push(this.b_prime_ref_j[0]);

    var theta;
    var i;

    this.bin_numbers = [];
    theta = 11.5;
    for (i = 1; i <= 16; i++) {
      var x = 1.35 * Math.cos((theta * Math.PI) / 180);
      var y = 1.35 * Math.sin((theta * Math.PI) / 180);
      theta += 22.5;
      this.bin_numbers[i - 1] = {
        x: x,
        y: y,
        xref: "x",
        yref: "y",
        text: `${i}`,
        font: {
          size: 12,
          color: "grey"
        },
        ax: 0,
        ay: 0
      };
